    def _get_zone(self, postal_code: str) -> dict:
        """

        :param postal_code:
        :return:
        """
        found_zones_fsa = []
        found_zones_full = []
        fsa = postal_code[0:3]

        for zone in self._zones:
            if postal_code in zone["PostalCodes"]:
                found_zones_full.append(zone)

            if fsa in zone["PostalCodes"]:
                found_zones_fsa.append(zone)

        # Delete
        print("----- FULL -----")
        for zone in found_zones_full:
            print(f"{fsa} - {zone['Name']}")
        # Delete
        print("----- First -----")
        # Delete
        for zone in found_zones_fsa:
            print(f"{fsa} - {zone['Name']}")
        # Delete

        if not found_zones_fsa and not found_zones_full:
            return {}

        if found_zones_full:
            return found_zones_full[0]

        return found_zones_fsa[0]

    def get_zones(self, order: dict):
        """

        :param order:
        :return:
        """

        origin_zone = self._get_zone(
            postal_code=order["CollectionLocation"]["PostalCode"]
        )
        print("*********************")
        destination_zone = self._get_zone(
            postal_code=order["DeliveryLocation"]["PostalCode"]
        )

        order["CollectionLocation"]["Zone"] = origin_zone
        order["DeliveryLocation"]["Zone"] = destination_zone

        return order
